ng\": 4.1, \"address\": \"Strada Glodeni 1-3, București 077190, Romania\", \"reviews\": [{\"text\": \"200 ml of hot water and one tea bag. 27RON. Why!? What a joke! Would not recommend to anyone just for this reason. A 0.5 water is way cheaper. Logic? ZERO\", \"time\": 1743288047, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/109878908997135114266/reviews\", \"translated\": false, \"author_name\": \"Dan Radulescu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjUpJg-QVJLv6w2eYljZ_tca9k9TSjH0XFBhhOqhkwfWMC1f31LdxA=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"3 months ago\"}, {\"text\": \"Another fantastic event at the premier spot in Bucharest!\", \"time\": 1750453757, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/112565442061923945271/reviews\", \"translated\": false, \"author_name\": \"Jonathan Smith\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjUlDeS6rywcgb_GMGL97FKoDARdRvnUORXmUqwt6U6EOIilNCU7=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"2 weeks ago\"}, {\"text\": \"Nice fun location.\", \"time\": 1734035672, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/107997223324376207920/reviews\", \"translated\": false, \"author_name\": \"Damon T\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVt2dbB0MTVDsQOG4DnByd86xUATAgm5J1K0Z6WG5DclnrscTVVGA=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"6 months ago\"}, {\"text\": \"Frateli Studios is a premier recording and production studio located in the vibrant city of Bucharest, Romania. Situated in the heart of the city, this state-of-the-art facility has been catering to the needs of artists, musicians, and content creators for over a decade.\\n\\nThe team at Frateli Studios is comprised of skilled and experienced professionals who are passionate about their craft. From recording and mixing to mastering and production, the team brings a wealth of expertise and creativity to every project they undertake. They understand that each client is unique, and they are committed to tailoring their services to meet individual needs and aspirations.\\n\\nIn addition to its exceptional recording and production services, Frateli Studios also offers a welcoming and creative environment for its clients. Its spacious and acoustically-treated recording rooms provide an ideal setting for artists to fully express themselves and capture their best performances. The studio\'s comfortable lounge area and green room ensure that clients feel relaxed and at ease during their time at Frateli Studios.\\n\\nIn summary, Frateli Studios in Bucharest is an exceptional recording and production facility that offers unparalleled services, top-notch equipment, and a team of highly skilled professionals. Clients can expect a welcoming and creative environment, where their artistic visions can be realized to perfection. Whether it is for music production, audio post-production, or any other audio-related project, Frateli Studios is the go-to destination for anyone looking for outstanding quality and a memorable recording experience in Bucharest.\", \"time\": 1687811706, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/107998426589955630515/reviews\", \"translated\": false, \"author_name\": \"Dr. Oana Codruta Bacean Miloicov\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVjO8tp2h-nyGIwVgUFt-21Ocz938iuLcyUz9Rc_btg23GK5IfJ3A=s128-c0x00000000-cc-rp-mo-ba6\", \"relative_time_description\": \"2 years ago\"}, {\"text\": \"Wine tasting event\", \"time\": 1747567912, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/102612166809302682652/reviews\", \"translated\": false, \"author_name\": \"Ami Ami\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjULmk0fHunei7NB1aywwPyLDBkKCi74xSBvoVjlp0XbDvaV6HwBfg=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"a month ago\"}], \"weather\": {\"humidity\": 41, \"wind_speed\": 8.23, \"description\": \"clear sky\", \"temperature\": 28.76}, \"website\": \"https://fratelli.ro/\", \"phone_number\": \"0722 115 115\", \"opening_hours\": null}', 5.000000, 7.000000, 1, 'Strada Nisipului 67'),
