PwnVaxpyJVzJIxkZXrVMS6Hb9Y4Tfx4cEaihQaeXo_xhR3IVc0V3Fc0ioeyJQjXu3_Tvl_HgeNLqX-hYdpX-Pzg4ch9aTRMC52cIo2syMh1IyT_L0nLI_pK5AbVOKxD6erdKc_VXEqXSCo0Aq_7rDu50Ep2_0mRpsIZcwVqXTCmWhXD1S6PSQ6dlsFKYPkvJBYD9TTwWiY&key=AIzaSyAFx94qZOmhNHRgEm17hh9C83bP_xXEwFI\", \"https://maps.googleapis.com/maps/api/place/photo?maxwidth=600&photoreference=ATKogpceiMj6xBbVXIx2kIHuToj1EFM7co9NyCzkIcqWIq08mRFLCaY5WuI1zEQTuBwa4B56eoBVFrvu0FEQQcdRjG10BkhS9wu0rC_QnvOt9if1pRWAk955Ev9GsXhJls6GYtL4qe0n4sXotNvpN7M1lzo7lqJkj8eGlvZ_igQgVDfMt1t-ywiBeAZk4ifzvNrNQY3c0s05VCxEgog8ojvhyX3yZosMcNUB18IQNcQ6FJA8Zk5_PHHYn_fcTXZlArM5UV92D-M88g4Wcl1K7D_MaQoUVekijwQuK4cD7IeLLjw8DUWnriWpOt77dSbUGaGFZexmcuaXNMk&key=AIzaSyAFx94qZOmhNHRgEm17hh9C83bP_xXEwFI\"], \"rating\": 3.8, \"address\": \"1, Calea Victoriei 63-81, București 010065, Romania\", \"reviews\": [{\"text\": \"Refreshing, Relaxed, and Worth It!\\n\\nI recently spent the day at Nami, the pool club at the Radisson Blu in Bucharest, and I genuinely don’t understand all the bad reviews floating around. Some people complained about loud music and high prices — my experience was the opposite.\\n\\nThe music was chill and low key, creating a perfect atmosphere to relax by the pool without feeling like you’re in a nightclub at noon. The entrance fee was about 20 euros, which is reasonable for a stylish pool club in the heart of Bucharest. Drinks were absolutely fair in price too.\\n\\nThe vibe is really nice: good crowd, comfortable loungers, friendly staff, and they serve great shisha too, which added to the holiday feel.\\n\\nIf someone wants to pay 5 euros for a drink or expects free pool access, maybe they should go to a public pool instead. Nami is for people who appreciate a beautiful, well-kept place and are willing to pay a fair price for quality and comfort.\\n\\nI’ll definitely be back — it’s a great spot to unwind in the city!\", \"time\": 1751279513, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/106825912874885612590/reviews\", \"translated\": false, \"author_name\": \"Francesco claudio\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXZKqcLcjDq3S6Ts-gHH9XxweqWetgmMhlY6bGqKBTmeqdCQqxk=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"in the last week\"}, {\"text\": \"Since the entrance everything is very luxurious and well organized. Very easy checking-in process, I was with my wife and we got a luxurious cabana sun bed with plenty of space and possibility of sun blocking.\\nThe hospitality of the staff is amazing, personally the concierg experience was better than the one from Aura Sky Pool from Dubai.\\nAlso, the drinks and food were very high quality and with reasonable prices.\\nWould definitely come back again! Congratulations\", \"time\": 1722328983, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/118053855082440035467/reviews\", \"translated\": false, \"author_name\": \"Alexander Iulian\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocJTPkUDIw1wo4W2Nsvg9GWlGqaT2AiY1xXK1sEwaxINkBeIae0=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"11 months ago\"}, {\"text\": \"Amazing experience. Good vibes.\\n3 times visited- one event and 2 times by the pool.\\nInteresting way to meet people or just hang out with friends.\\nThe staff was on top of the service requirements. Promptly. Good cocktails too.\", \"time\": 1720361168, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/101497774036546645596/reviews\", \"translated\": false, \"author_name\": \"Anda Zaharia\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjUaOiOUKak5SZLztH-sZsPKjodpNPaI2Oza-p_mQPlpi_c7WnHecA=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"12 months ago\"}, {\"text\": \"Plusses... Beautiful pool nice chairs good sun.\\nMinuses... They kicked us out at 11a for a private party that was not on the site or when we called over.  Glad they could make $ 🤔\", \"time\": 1749715807, \"rating\": 3, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/115504270162446542527/reviews\", \"translated\": false, \"author_name\": \"Michael Shannon\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXfWg3YDfXTKo8U1ht725-306MTd-rgaiuhl173-AhFmy1Xc81zOQ=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"3 weeks ago\"}, {\"text\": \"A mini-paradise where you forget that you are in the middle of Bucharest. Very delicious food, well-balanced drinks that look very Instagrammable. And the staff reminds you that you are still inside a 5-star hotel. I love it!⭐️ ⭐️⭐️⭐️⭐️🤩\", \"time\": 1718643851, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/106050922747502429020/reviews\", \"translated\": false, \"author_name\": \"Ana-Maria Luchian\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVw58mili4-L2531u_PU0t_Rh7JaEwU2doHzH89lE8BaV2V0lHi=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"a year ago\"}], \"weather\": {\"humidity\": 42, \"wind_speed\": 8.23, \"description\": \"clear sky\", \"temperature\": 28.39}, \"website\": \"http://www.namibeachclub.ro/\", \"phone_number\": \"0732 221 635\", \"opening_hours\": [\"Monday: 10:00 AM – 8:00 PM\", \"Tuesday: 10:00 AM – 8:00 PM\", \"Wednesday: 10:00 AM – 8:00 PM\", \"Thursday: 10:00 AM – 8:00 PM\", \"Friday: 10:00 AM – 8:00 PM\", \"Saturday: 10:00 AM – 8:00 PM\", \"Sunday: 10:00 AM – 8:00 PM\"]}', 0.000000, 0.000000, 1, ''),
