 Beach, Constanța 900001, Romania\", \"reviews\": [{\"text\": \"Other than some algae, no complaints. It can be crowded but it\'s a huge stretch of beach so you\'ll find more quiet private spots. The waters are warm and not too many waves usually.\", \"time\": 1720199621, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/116572674538993717559/reviews\", \"translated\": false, \"author_name\": \"S E\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocKWrdC1jMJyTkGufvuYXrAo4jxwdoSwP3qJoMkYNAZGzw72xg=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"12 months ago\"}, {\"text\": \"It’s a nice place if you are a fakir. It’s like walking on glass. Heavy wind makes your life miserable. Black Sea at its best…\", \"time\": 1664641302, \"rating\": 2, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/109456709244697223365/reviews\", \"translated\": false, \"author_name\": \"Marian Knysza\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVI3a2PFf-Tt2cgyOoUelvTwtbW7DXfqLamEDvdYiLIEOMZJijd=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"2 years ago\"}, {\"text\": \"Not impressed. 5x more expensive than neighbour beaches. Staff were slow. Had to chase them for anything. Expected finer sand. On the plus side it had wifi and decent lounge options\", \"time\": 1498836022, \"rating\": 3, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/112664583965675862448/reviews\", \"translated\": false, \"author_name\": \"Simona Pop\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXREaDpcYmpbH2RextJvC4cDcPfLDJnSjwZXSR8bCjoP_UpQHYz=s128-c0x00000000-cc-rp-mo-ba2\", \"relative_time_description\": \"8 years ago\"}, {\"text\": \"Even though the beach is now definitely bigger and there\'s a longer walk to the sea, Vega beach still looks like one of the best beaches in the area, with showers, lots of beach chairs and an amazing vibe.\", \"time\": 1631980412, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/112121382113415088398/reviews\", \"translated\": false, \"author_name\": \"Zorina Constantinescu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocLuStVQ9vI31jI5z8gTsj226CETPzWOZtD_qP7v6u9mogx-Aw=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"3 years ago\"}, {\"text\": \"Quiet place in the evening, coffee is great...\", \"time\": 1561783912, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/113896190358540285982/reviews\", \"translated\": false, \"author_name\": \"Ghizdavescu Bogdan\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjV9zFW3hMWrUQkDgDKqnNiTpM1JOiYy7nBLoXSNr95ImDqUgU5A=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"6 years ago\"}], \"weather\": {\"humidity\": 42, \"wind_speed\": 4.63, \"description\": \"clear sky\", \"temperature\": 29.62}, \"website\": \"http://www.hotelvega.ro/\", \"phone_number\": \"0241 607 607\", \"opening_hours\": [\"Monday: 8:00 AM – 8:00 PM\", \"Tuesday: 8:00 AM – 8:00 PM\", \"Wednesday: 8:00 AM – 8:00 PM\", \"Thursday: 8:00 AM – 8:00 PM\", \"Friday: 8:00 AM – 8:00 PM\", \"Saturday: 8:00 AM – 8:00 PM\", \"Sunday: 8:00 AM – 8:00 PM\"]}', 0.000000, 0.000000, 1, ''),
