: 4.2, \"address\": \"Mamaia-Sat, Romania\", \"reviews\": [{\"text\": \"A great place for relaxation and entertainment. Beautiful restaurant and excellent service. Thanks to the team, our vacation was wonderful. See you soon!\", \"time\": 1688651600, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/109510780409547430049/reviews\", \"translated\": false, \"author_name\": \"Serhii Barkov\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVUZZfqUxLrOsqJZpcYH-9R4khnsfym2H1gJQ46p_32co2bIx0_dA=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"Good cocktails and service. I also like the color matches of sun beds and umbrellas☺️\", \"time\": 1661527065, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/103857005380570293852/reviews\", \"translated\": false, \"author_name\": \"Elena Semushina\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXD6QxfpFh199X7MrvGTI-DeQTDWbzT2upo3K354u-arPkZ8E60=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"2 years ago\"}, {\"text\": \"Good location and clean facilities, BUT: loud club music at lunchtime will not atract restaurant type customers. lounge music played low key works better daytime. Staff is not client orientated, they are tiktok oriented. atract clients with polite and friendly crew.\", \"time\": 1688207526, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/106242296198318580175/reviews\", \"translated\": false, \"author_name\": \"Marine Kompass\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjX1k9Vf2kAT2VkCFzP7TAMCiLSR859Ow3z5NWjZLfyPO3W8Y1A=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"2 years ago\"}, {\"text\": \"You could turn down your music or turn it off altogether. People prefer to hear the sound of the sea. The deckchairs are old, heavy.\", \"time\": 1688294695, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/107878299150993786461/reviews\", \"translated\": false, \"author_name\": \"arts sein\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocLagcCIKtbdRpJoUaZpC_UFG-Z287MksOEp0C1E5jGBFdseGQ=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"2 years ago\"}, {\"text\": \"The place to be! Kind staf great pizza verry good drinks viva la cuba libre crispy pizza very good music !!!\\nVery clean beach 👌👌👌👌\", \"time\": 1690900253, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/117828599828242784584/reviews\", \"translated\": false, \"author_name\": \"Emilian Turcanu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocIoBpMFnaGzIzdiaDhr4VtleRApbRwhoVp1iWSbz_yN9KJCdA=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"a year ago\"}], \"weather\": {\"humidity\": 42, \"wind_speed\": 4.63, \"description\": \"clear sky\", \"temperature\": 29.63}, \"website\": null, \"phone_number\": \"0757 996 600\", \"opening_hours\": [\"Monday: Open 24 hours\", \"Tuesday: Open 24 hours\", \"Wednesday: Open 24 hours\", \"Thursday: Open 24 hours\", \"Friday: Open 24 hours\", \"Saturday: Open 24 hours\", \"Sunday: Open 24 hours\"]}', 0.000000, 0.000000, 1, NULL),
