ime_description\": \"11 months ago\"}, {\"text\": \"Thanks to Pablo and Jordi, a great change and attention, the cocktails are the best, you can feel the change, and we\'ll be back. Thank you for welcoming us so warmly 💜\", \"time\": 1750539400, \"rating\": 5, \"language\": \"en-US\", \"author_url\": \"https://www.google.com/maps/contrib/110495352693375241090/reviews\", \"translated\": true, \"author_name\": \"Marc Ballester\", \"original_language\": \"es\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocK83htCXZB9iGzegxcpjVYLQACoWnLVeYmiV7V5BKH6pWFM6w=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"a week ago\"}, {\"text\": \"Very good service, we highly recommend it. Great atmosphere and location.\", \"time\": 1750581280, \"rating\": 5, \"language\": \"en-US\", \"author_url\": \"https://www.google.com/maps/contrib/110857027549670515028/reviews\", \"translated\": true, \"author_name\": \"María\", \"original_language\": \"es\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocKHmXat9R18u5908PQVQA17pO39fV1_cg48aXDcfTx7XwRpwVs=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"a week ago\"}, {\"text\": \"We went by chance and we found a super charming place and some amazing cocktails!!! Thanks to the waiter, Jordi, who surprised us with them because we didn\'t know what to order hahaha I recommend it 100%, they also make shisha.\", \"time\": 1718132503, \"rating\": 5, \"language\": \"en-US\", \"author_url\": \"https://www.google.com/maps/contrib/114406328405624804252/reviews\", \"translated\": true, \"author_name\": \"Diana Paula Sandu\", \"original_language\": \"es\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXiyoxygiCgF_stln_Hrv1gCgP8lo8aIW8dr99wRxG5gsO-jYG1nw=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"Terrace with varied music to have a cocktail at a reasonable price. They don\'t provide anything as an appetizer, even if you ask for it...\", \"time\": 1693346807, \"rating\": 3, \"language\": \"en-US\", \"author_url\": \"https://www.google.com/maps/contrib/109978282610911849773/reviews\", \"translated\": true, \"author_name\": \"Vanessa Quiros\", \"original_language\": \"es\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjV4WpAAnHcuU7UW9FYxDJHun7Q5znTSu22BkJmnQoFgFr53rePY=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"a year ago\"}], \"weather\": {\"humidity\": 50, \"wind_speed\": 2.77, \"description\": \"light rain\", \"temperature\": 30.11}, \"website\": null, \"phone_number\": \"678 00 35 56\", \"opening_hours\": [\"Monday: 7:00 PM – 2:30 AM\", \"Tuesday: 7:00 PM – 2:30 AM\", \"Wednesday: 7:00 PM – 2:30 AM\", \"Thursday: 7:00 PM – 2:30 AM\", \"Friday: 7:00 PM – 2:30 AM\", \"Saturday: 7:00 PM – 2:30 AM\", \"Sunday: 7:00 PM – 2:30 AM\"]}', 0.000000, 0.000000, 1, ''),
