, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/110597477285540069315/reviews\", \"translated\": false, \"author_name\": \"Valentina Andrei\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocK4nLpV9sWyz3wlGzFv0IDVxgoYYFrZU8ZyJvHpOEhFaqH5Cg=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"a month ago\"}, {\"text\": \"This is the worst place you can go to in Bucharest! We called before going they said no need for reservation just walk in, we were 3 girls trying to enter. At first the hostess said she will check and come back, 5 mins later she came back and said we are not allowed in because of the way we dress and it doesn’t match the dress code for the place!! Literally while we are standing a lady entered with sneakers and backpack. While we were dressed up with skirts and flats.\\n\\n5 mins later the manager came and repeated the same comment that we are not dressed as per the dress code. When we asked what was the dress code they said sth in Romanian and laughed. The hostess herself was wearing shorts, again what dress code are we talking about???\\nTotal failure\", \"time\": 1749287556, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/105693415145888110159/reviews\", \"translated\": false, \"author_name\": \"dana khleif\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocLWilE8DrmuVCb_Q1yEjrvjNkmX6wbYy6_WRb-R6aRnRR6fSw=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"3 weeks ago\"}, {\"text\": \"DON\'T EAT HERE IF YOU DON\'T WANT TO BE INTOXICATED!!!\\nI was there this Saturday with 4 of my friends; we had a table reserved, we ordered food, and guess what? One of my friends and I got sick because of the food!!! I ate tiger prawn with glass noodles salad (photo), and my friend ate beef donburi. I felt nauseous after we left, and a couple of hours later, I was vomiting even the food I didn\'t eat! I vomited 6 times, from hour to hour, until I went to the hospital in the emergency room because I couldn\'t bear it anymore! And my friend had diarrhea in the morning several times! So be aware! It\'s so fancy and so expensive that you don\'t expect to get food intoxicated! And after you pay the same amount of money at the hospital to get well from a night in which you were supposed to feel great! I would give them zero star!!!\", \"time\": 1688418233, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/102604732826730009242/reviews\", \"translated\": false, \"author_name\": \"IoaNNa\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocJmXkywzkDCT05ZKeMquwbrm3F3mzv6QWukez7sm3DCQqU4VA=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"2 years ago\"}, {\"text\": \"Awesome vibes, great music, and amazing food! Totally recommend!\", \"time\": 1749205696, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/113162858500863415552/reviews\", \"translated\": false, \"author_name\": \"Alexandra\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocI4LvVyXB9DN3UyiqqKP0vlQMB3EbIzqeVqpTpToN2lSkfh3g=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"4 weeks ago\"}, {\"text\": \"NEVER COME TO THIS PLACE, NEVER ! Before coming to this club. I called Nuba and asked if there is a reservation needed in order to enter the club. The lady told me there is no reservation needed. We are welcome to come, they are waiting for us. We arrived to NUBA and Security was extremely rude with us. They did not let us in because we do not have a reservation.\\n\\nI called NUBA right back in order to ask what is going on. Before coming I tried to double check if there is a reservation needed. If so,  I would reserve a table prior to arriving. The lady told me there is nothing she can do right now. Either I pay double for the table at the entrance or I will not get into the club.\\n\\nThis Club is trying to SCAM you. I will never ever come to this club again!\", \"time\": 1728770336, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/113612094216804545337/reviews\", \"translated\": false, \"author_name\": \"Batog Bogdan\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocIqjzD_e1WDjQiDof6x7KoEASphwT9AyTmvFrgV9SegBM-I=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"8 months ago\"}], \"weather\": {\"humidity\": 42, \"wind_speed\": 8.23, \"description\": \"clear sky\", \"temperature\": 28.61}, \"website\": \"http://www.nuba.ro/\", \"phone_number\": \"0768 226 822\", \"opening_hours\": [\"Monday: Closed\", \"Tuesday: Closed\", \"Wednesday: Closed\", \"Thursday: 9:00 PM – 4:00 AM\", \"Friday: 9:00 PM – 4:00 AM\", \"Saturday: 9:00 PM – 4:00 AM\", \"Sunday: Closed\"]}', 0.000000, 0.000000, 1, NULL),
