s\": \"Constanța 900178, Romania\", \"reviews\": [{\"text\": \"Mainly locals. Not too crowded. Easy access. Easy to find parking nearby.\", \"time\": 1725615984, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/117604158060832015095/reviews\", \"translated\": false, \"author_name\": \"Nurten Rasid\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVz-O3Prgjxjj2nUMO8C2plc7OrfJSZy0y02rxSloXv5h1KbLtf=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"10 months ago\"}, {\"text\": \"Pros: not too crowded, water clean enough, long area (10-15 m) with no deep water (less than 1.5 m), sunbeds and spacious sheets area\\nCons: Too few trash bins (and many of them overflowing), lots of cigarette butts and small garbage spread all over.\\nPrices:\\nSunbed: 30 lei (6 euros)/day\\nBeer: 5-12 lei (1-2.5 euros)\\nSoda: 6-7 lei (1-1.5 euros)\", \"time\": 1628829137, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/115048223214677556895/reviews\", \"translated\": false, \"author_name\": \"Tanas\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocJuSu4AhdwOmTv5IqxZ-RSbWXrMt7oXawkRHoquJByQP9QWDQ=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"3 years ago\"}, {\"text\": \"Big and beautiful beach. Few terraces available so plenty of drinks and food available. Sun beds and umbrellas aveilable too. Costa cafe on neversea beach is my favourite. ❣💯👌\", \"time\": 1598872926, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/110525943227786312328/reviews\", \"translated\": false, \"author_name\": \"Ela\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVCVmxV-rVy3L_Pkf3rtRn6UQQeGpA4Z_ImvIFrE1zU2G10aeElbw=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"4 years ago\"}, {\"text\": \"Although it\'s a public beach, it has all the facilities in order. Parking lot, food area, lifeguards, thin sand, showers, terraces and the sea bed is safe w/o rocks  for at list 50m.\", \"time\": 1596568232, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/116622818284422386106/reviews\", \"translated\": false, \"author_name\": \"Paul ANTONESCU\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjV5EtU3aXkciXSVV9APuczCiJK54mw5yfhTj5scrnAcxUdkLYXVzQ=s128-c0x00000000-cc-rp-mo-ba6\", \"relative_time_description\": \"4 years ago\"}, {\"text\": \"The see was incredibly warm in August, pretty much sea weed though. The sand is clean with shells nearby water scratching feet a little bit. There are some big stones, very beautiful to take photos. But also it is difficult to get a long upstairs way when leaving the beach. The water is not very clean, but ok though, also extremely salty. Waves are pretty big but not dangerous.\\nAlso, it is difficult to find a bathroom or a place to put on the bathing suit, we walked almost half an hour to find one.\", \"time\": 1567288463, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/117203582920698346457/reviews\", \"translated\": false, \"author_name\": \"Natalia Malenchi\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjUPOW1o2ehf_6hBuczDImt06psPXZDuw4eip4TzuiKR1fjAUEc=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"5 years ago\"}], \"weather\": {\"humidity\": 60, \"wind_speed\": 4.8, \"description\": \"clear sky\", \"temperature\": 29.62}, \"website\": null, \"phone_number\": \"Nespecificat\", \"opening_hours\": [\"Monday: Open 24 hours\", \"Tuesday: Open 24 hours\", \"Wednesday: Open 24 hours\", \"Thursday: Open 24 hours\", \"Friday: Open 24 hours\", \"Saturday: Open 24 hours\", \"Sunday: Open 24 hours\"]}', 0.000000, 0.000000, 1, NULL);
