rating\": 4.4, \"address\": \"Strada Turda, Constanța 900527, Romania\", \"reviews\": [{\"text\": \"I would say that it’s the best on Constanta coast. The price for sunbeds is great (50 lei), the place is amazing for cool photos and videos. The food was good, but pizza & calmars could be improved. Overall atmosphere is amazing, it’s our second time here, recommend 💛\", \"time\": 1751289491, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/110562693437039144045/reviews\", \"translated\": false, \"author_name\": \"Lily Khimchenko\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjV7LPD0d0c23CgYsRsR4D9uJQj0qD4qj7_GNIBMT4yARfHiCPhL=s128-c0x00000000-cc-rp-mo-ba2\", \"relative_time_description\": \"in the last week\"}, {\"text\": \"‼️We arrived on this beach around 11am and asked about all facilities and how does it work to order and so on. Once we set up the umbrella, service was very poor, the QR order by the table was not working, no staff, the couple of young helpers were on their phone not to be disturbed. I had to talk over a phone with the number is displayed on website. Kitchen supposed to be open by 12:00, they opened by 14:30. Except fried calamari, everything was bad. They look for excuses instead of getting things done. Do yourself a favour and go somewhere else‼️‼️‼️The toilets are outbreak of infection ‼️‼️‼️\", \"time\": 1750170573, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/114967203566716152276/reviews\", \"translated\": false, \"author_name\": \"MiT giKo\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWcOIEptNf_Ma2wCfiTdteKNRqMj0Vql4lOzoNGW9Tz2zwGLmg=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"2 weeks ago\"}, {\"text\": \"The place looks amazing, and the music is good not gonna lie.\\nWhen is about the service…guess what?: some of the people were decent but one of the main bartenders was so rude and disrespectful.\\nIf you are asking for a small tray to carry your own drinks to the table on the beach…he is giving you that whole attitude and he had the nerve  to tell that: ,,you don’t need a tray mate to carry few drinks and shots”.\\nWith all of the respect, you can go to other different beaches easily and enjoy your time instead to have your day ruined by an individual like that.\\nI wouldn’t even bother to write this review but when your vibe is ruined in your holiday….I can’t stay quiet.\\n\\nAll the best mates.\", \"time\": 1750603661, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/116149716126879153459/reviews\", \"translated\": false, \"author_name\": \"Vasile Alexandru Burloi\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocLbAWRjNcUahjHYrBZfaDoteEC9yEUY2qqluwGFkE0qcAy0Bw=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"a week ago\"}, {\"text\": \"The food is ok, the service quite slow but ok. The real reason to go there is the location and the setup. They decorated the place with sculptures, mirrors, lights and many other piece of art that gives very cool vibes to the place! There are many different \\\"rooms\\\" (or environments, since it is outdoors) with different atmospheres, a maxi-screen, and it is literally on the beach. Approved!\", \"time\": 1721657452, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/101283929175962327202/reviews\", \"translated\": false, \"author_name\": \"Gioia Sesto\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjUDS6reMoEx0aV-eQHsGxy1V3q3L5WJjOFYIo3BpTM41FS-QaQ=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"11 months ago\"}, {\"text\": \"You have to order the drinks from the bar and the food from.. I don\'t know. There is no guidance or server here. Club atmosphere with no service. Tables and chairs were dirty and wet. Would not recommend.\", \"time\": 1751213505, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/117198627995585493840/reviews\", \"translated\": false, \"author_name\": \"Andreea Sirbeanu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVeFPRE86scPStDcxU6aGkp5a9fcjvyahzFaRJodQJ9T3fiuF4=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"in the last week\"}], \"weather\": {\"humidity\": 60, \"wind_speed\": 4.8, \"description\": \"clear sky\", \"temperature\": 29.54}, \"website\": \"https://m.facebook.com/ZoomBeachConstanta/\", \"phone_number\": \"0790 622 303\", \"opening_hours\": null}', 0.000000, 0.000000, 1, NULL),
