ess\": \"Strada Belvedere 4, Constanța 900001, Romania\", \"reviews\": [{\"text\": \"Go were the locals go. Moon beach is a place which takes a bit effort as it is not on the main beach but the next one. Though you will be rewarded greatly.\\nThey prepare all drinks you can ask for selling ice cream. Staff speaks splendidly English. A toilet is avialable too.\\n\\nI recommend taking the sitzacks to get the best feeling of beach sun and the sea breeze.\\nThe place to enjoy a sunset :)\", \"time\": 1686577114, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/100129186926843162942/reviews\", \"translated\": false, \"author_name\": \"Josef W\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWiVouQjcRArlYJUXKrOXbtdNrZbvxudQxI515-QwR0XMvL9MrM=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"2 years ago\"}, {\"text\": \"Among the most beautiful beaches in Constanta! Fine sand, clean water and it\'s quite free.\", \"time\": 1723037868, \"rating\": 5, \"language\": \"en-US\", \"author_url\": \"https://www.google.com/maps/contrib/108087644917235043335/reviews\", \"translated\": true, \"author_name\": \"Laura\", \"original_language\": \"ro\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocLUVxZJj0iDvRDdxCnxol8VGnBAsMRm_KLbIJtrG-sUaudkkA=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"11 months ago\"}, {\"text\": \"Being a beach bar, the ambiance is exactly what you would expect, music, warmth, shady places, affordable prices for sunbeds and cold drinks. I didn\'t order food because I only saw snacks, they have a menu in QR format, so you can see the options closer\", \"time\": 1721287845, \"rating\": 5, \"language\": \"en-US\", \"author_url\": \"https://www.google.com/maps/contrib/116648379547328719350/reviews\", \"translated\": true, \"author_name\": \"Răzvan Apostol\", \"original_language\": \"ro\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWStvZgF_xwa7PINWQMf6_iYif8Xs6sAbAM74bgwAdWqc9jrvY=s128-c0x00000000-cc-rp-mo-ba2\", \"relative_time_description\": \"11 months ago\"}, {\"text\": \"A tastefully decorated beach, fine sand and comfortable mattresses.\", \"time\": 1689494980, \"rating\": 5, \"language\": \"en-US\", \"author_url\": \"https://www.google.com/maps/contrib/117128207931963376695/reviews\", \"translated\": true, \"author_name\": \"Mihaela Tita\", \"original_language\": \"ro\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocJY2l3FlB2-TzGbQeME54ut72j11zPCkeECLXYPvNRaI0fJhrtP=s128-c0x00000000-cc-rp-mo-ba2\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"The coolest beach in Constanta! I recommend 100%. Super welcoming staff\", \"time\": 1657441307, \"rating\": 5, \"language\": \"en-US\", \"author_url\": \"https://www.google.com/maps/contrib/116207987414398555708/reviews\", \"translated\": true, \"author_name\": \"Rares Fana\", \"original_language\": \"ro\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocJMk325pQkX7lG8nIBb5f557NsT1FiTyDv1g3RK-0PCvk6Wmtg=s128-c0x00000000-cc-rp-mo-ba2\", \"relative_time_description\": \"2 years ago\"}], \"weather\": {\"humidity\": 60, \"wind_speed\": 4.8, \"description\": \"clear sky\", \"temperature\": 29.54}, \"website\": null, \"phone_number\": \"0727 213 288\", \"opening_hours\": [\"Monday: 8:00 AM – 10:00 PM\", \"Tuesday: 8:00 AM – 10:00 PM\", \"Wednesday: 8:00 AM – 10:00 PM\", \"Thursday: 8:00 AM – 10:00 PM\", \"Friday: 8:00 AM – 10:00 PM\", \"Saturday: 8:00 AM – 10:00 PM\", \"Sunday: 8:00 AM – 10:00 PM\"]}', 0.000000, 0.000000, 1, NULL),
