ive_time_description\": \"a year ago\"}, {\"text\": \"Tip top\", \"time\": 1749901867, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/101883081989476975019/reviews\", \"translated\": false, \"author_name\": \"Ingo Germer\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWqQ9wKrrkSRHKr07pv1059RDKKUz211GosMTTiceNkhJh0aCvHqw=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"2 weeks ago\"}, {\"text\": \"Gorgeous restaurant, tasteful interiors by the side of a lake. The food is also pretty decent with many choices.\", \"time\": 1696559813, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/112246022372564307882/reviews\", \"translated\": false, \"author_name\": \"mehnaz ali\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocKlKdtV8SxWEgGlkUaNtHEV6SJFNFtC1aa0rO9M92J8PrFVcw=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"a year ago\"}], \"weather\": {\"humidity\": 51, \"wind_speed\": 4.63, \"description\": \"broken clouds\", \"temperature\": 22.47}, \"website\": \"https://www.aloha-beach-house.com/\", \"phone_number\": \"02462 2069980\", \"opening_hours\": [\"Monday: Closed\", \"Tuesday: 2:00 – 11:00 PM\", \"Wednesday: 2:00 – 11:00 PM\", \"Thursday: 2:00 – 11:00 PM\", \"Friday: 2:00 – 11:30 PM\", \"Saturday: 12:00 – 11:30 PM\", \"Sunday: 12:00 – 11:00 PM\"]}', 0.000000, 0.000000, 1, NULL),
