ja 3 papuci, Constanța, Romania\", \"reviews\": [{\"text\": \"Cheap sunbeds (from wood) and umbrella, 30 lei per set. Good range of cold and hot drinks and some snacks. Beach quite clean although full of shredded seashells and sand, shoes recommended. Only near the waterfront is fine sand, perfect for kids playing there. Low music level which makes the day relaxing. Toilet not very clean, trash bins available. Only little waves due to 2 digs on the left and right of the Beach. Overall we enjoyed our stay and can recommend this beach. Enough parking space available if you don\'t come too late...\", \"time\": 1533455926, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/113714343168021644167/reviews\", \"translated\": false, \"author_name\": \"Andreas Zeller\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocJxDN9R8GsYYqbfrEkaNwuEgMib4_L7zUcdZ3v9WwavO5TVcg=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"6 years ago\"}, {\"text\": \"\\\"Royal beach\\\"! Nice\", \"time\": 1561472951, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/114569087546091060268/reviews\", \"translated\": false, \"author_name\": \"George Ferferi\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocIemn4jEHYEJYq0ExRyVjXz-pPba1LfckJ0Rr3WCCnE2jlbXg=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"6 years ago\"}, {\"text\": \"Loud music. Over expensive drinks and snaks. Keep away! Poor experience!\", \"time\": 1532215492, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/114417457418521727008/reviews\", \"translated\": false, \"author_name\": \"Bogdan Rusu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjUeQMmcEst8aEesh-YSXZYjIYUAhNxMnmIj7NLVR85P2VmuFa57=s128-c0x00000000-cc-rp-mo-ba3\", \"relati