D10 Street 1, Mamaia-Sat 905701, Romania\", \"reviews\": [{\"text\": \"Came here yesterday night and the food was amazing. There was no mistake with food and I would highly recommend for food, but the reason I’m giving 1 star is because of the rude server and how he treated my family. I don’t know what was the issue with him, was it cause we were speaking English or we were not Romania’s but he made us feel uncomfortable, he was rude. He threw our food on our table, he never asked or came to check if our food was ok, if we asked him something like for extra drink he rolled his eyes.\\nWe thought he did that with everyone but upon observation he didn’t. He went and talked nicely with another couple sitting next to us and other customers but with us he had a stick up his a$$.\", \"time\": 1719543595, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/106328051307618767587/reviews\", \"translated\": false, \"author_name\": \"Moeez Muhammad\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjV3QwskpR-ioEJ43sRtF2hs6Y59oacGfVjq5LszCDPP3IyDkPU=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"Coffee is very good.\\nUnfortunately they have a dog which is kind of  cute mascot of the place...but is still a restaurant and a dog between your legs and around the tables is not what you are looking for, when enjoying your orders.\", \"time\": 1621877005, \"rating\": 3, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/115726676779724784272/reviews\", \"translated\": false, \"author_name\": \"Emilia Teodora Badarau\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocIfyN1IwW14WHQ8GBqpZvevKWrhLF7lYpRsP46uJOsa55FiSw=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"4 years ago\"}, {\"text\": \"Ordered a “chicken specialty” which was literally some chicken nuggets with cold fries. When we asked if we could get new fries because these were cold, they took the plate and said “yes of course” and then they literally put the plate in the microwave and brought it back to us 😂\", \"time\": 1691489132, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/103813354290643155241/reviews\", \"translated\": false, \"author_name\": \"Danique Hooijschuur\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjV9AsIHRrkYvYtxBX5cyTCiK99UJ8mYJbOHp3P5zeE15QwAOc2J=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"Great restaurant with all kind of Romanian and international foods. The pizza lovers will be happy. The burgers are delicious as well.\", \"time\": 1597164259, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/102661664472688657186/reviews\", \"translated\": false, \"author_name\": \"S M\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjUgLnwYfx23RlNF5ZBx1fR2f7n78arq5fW6BEJppf08_RydXL0X=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"4 years ago\"}, {\"text\": \"Poor quality service. You leave for lunch and they give away the beds you paid for the day. They treat you with no respect. Beverages are also expensive compared to their neighbours.\", \"time\": 1563114880, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/107095082526437515594/reviews\", \"translated\": false, \"author_name\": \"Mara Dragomir\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVIq3wzuwL72R4PxQcOe1QHNvyRlG5rfAocu4V9u31OeMwmNocw=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"5 years ago\"}], \"weather\": {\"humidity\": 42, \"wind_speed\": 4.63, \"description\": \"clear sky\", \"temperature\": 29.63}, \"website\": \"https:/