\"], \"rating\": 4.2, \"address\": \"Strada D12, Năvodari 905700, Romania\", \"reviews\": [{\"text\": \"Both pizzas were cold . I mean really cold. Service wasn’t attractive and very slow. And all of this at high price. Wouldn’t recommend and wouldn’t go back.\", \"time\": 1750528929, \"rating\": 2, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/115616589841916635622/reviews\", \"translated\": false, \"author_name\": \"Інна\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocIRcgcCA8OUXNPORJfSa2AKyaoW7bbHsvtPjqD5GeQuS8ZDFw=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"a week ago\"}, {\"text\": \"Great location, great atmosphere, cool vibe and great staff. Very good service\", \"time\": 1751038546, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/118217327425484354632/reviews\", \"translated\": false, \"author_name\": \"Corina Manoliu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocLbVI1h0SRKPVN58XETOCCikjelIhu510a-TEIF7WG5_maZSw=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"a week ago\"}, {\"text\": \"Great beach. The service was also very good.\", \"time\": 1751143579, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/108468194107950238932/reviews\", \"translated\": false, \"author_name\": \"Kadir Amet\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXkXM75UQBCX56F6XmW0Em6cB2EFjCvONJLNnlLrET3TXV5ph8I=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"in the last week\"}, {\"text\": \"The waiter was extremely rude and impatient when taking our order. When asked if they had any fresh items, he responded, \\\"We are a respected place and after a certain hour we don’t serve any type of fresh.\\\" He refused to take our order until everyone had decided, even though I was extremely thirsty. Ultimately, I felt so uncomfortable that I had to leave the place.\", \"time\": 1720033179, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/109527502527268015539/reviews\", \"translated\": false, \"author_name\": \"Alejandra Dumas\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjUMudoRYcfMujlcWC0__6lJU1DaM8xFvz53wy4QzKIPNhXzOqbh=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"We ordered starters, the fish soup, some pasta and dessert. They messed up the order, they brought out the wrong food...twice. And dessert took over 30 minutes to arrive by itself. Why? It was already done, but the kitchen does what it wants.\\n\\nVery disorganized place.\\n\\nAlso, there was a DJ which is nice but the music was way too loud and monotonous.\\n\\nAvoid this place.\", \"time\": 1722170009, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/118130051937582721463/reviews\", \"translated\": false, \"author_name\": \"On Air\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVpxDDcwaDVmPd_8Xk4_zhj_-0akqmwg2msDWwwnjWNeaTXOqg=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"11 months ago\"}], \"weather\": {\"humidity\": 42, \"wind_speed\": 4.63, \"description\": \"clear sky\", \"temperature\": 29.63}, \"website\": null, \"phone_number\": \"0723 195 275\", \"opening_hours\": [\"Monday: 8:00 AM – 1:00 AM\", \"Tuesday: 8:00 AM – 1:00 AM\", \"Wednesday: 8:00 AM – 1:00 AM\", \"Thursday: 8:00 AM – 1:00 AM\", \"Friday: 8:00 AM – 4:00 AM\", \"Saturday: 8:00 AM – 4:00 AM\", \"Sunday: 8:00 AM – 1:00 AM\"]}', 0.000000, 0.000000, 1, NULL),
