s\": \"Plaja Cap Midia, Năvodari 905700, Romania\", \"reviews\": [{\"text\": \"I read the comments and I am surprised. People, haven\'t you noticed that you are in an industrial area?! I am sometimes shocked by Romania :) there are wonderful people here, but sometimes you are very surprising\", \"time\": 1748209159, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/110783771643627777463/reviews\", \"translated\": false, \"author_name\": \"Den\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXZB4kIR8CuGAZ2tjyrysRFx3G17__bgRWQM3dQfk7YaZw0HVw=s128-c0x00000000-cc-rp-mo-ba2\", \"relative_time_description\": \"a month ago\"}, {\"text\": \"Fine sand, clean water and full of sea 🐚\", \"time\": 1724424669, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/109038424215830529011/reviews\", \"translated\": false, \"author_name\": \"Mircea Mircea\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjU1RkhO78475eCQ9-nq13_dZvppd87K180TYJeSggtxpbrLoAAy8w=s128-c0x00000000-cc-rp-mo-ba2\", \"relative_time_description\": \"10 months ago\"}, {\"text\": \"A very nice place, not that croweded, away from the noise , very classy with nice swing/matrasses , and tents , you can also camp here with your trailer and u have only drinks at the beach bar, no food  and if u want big oyster shells here are plenty ... i recommend this if u are looking for a quiet place... Mamaia and Navodari are too crowded 😁\\nThe bad  part is the sand , the price is pretty high for a chair at least they could filter or clean the sand 🙃\", \"time\": 1724324700, \"rating\": 3, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/116011995458852799204/reviews\", \"translated\": false, \"author_name\": \"Mihaiu Emanuel\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWvejOz0lXaIlGJUVpQ_m02tVHgDshgAdwZVZZzmYiykB45SMEM=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"10 months ago\"}, {\"text\": \"Great beach! Very clean and family friendly. The entry in the water is perfect for small children. Food is good and prices are fare. Sunbeds are placed with a perfect distance from one another.\\n\\nWe will definitely be back!\", \"time\": 1694414652, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/117855040691411313205/reviews\", \"translated\": false, \"author_name\": \"Mihaela Sima\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVozZ3EcTTjIpJchKI5Vef1nzySKBpepKdReMs9OTXzF1gBTJMX=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"Great place to enjoy the sun.  Beach has spot with sunbeds and different spot for those who want to use towels . Beach has great fine sand and shells are everywhere for the kids to enjoy gathering. In the back of the beach there is a fun park where everyone can exercise and have fun at the same time\", \"time\": 1694414837, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/114099494965072634795/reviews\", \"translated\": false, \"author_name\": \"Cristurean Catalin\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjU9S-JHt8FSk9CHit5Jl3W3TbS2ZnlftCmAwRpyAjl2JOibJkS9cg=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"a year ago\"}], \"weather\": {\"humidity\": 45, \"wind_speed\": 4.63, \"description\": \"clear sky\", \"temperature\": 29.53}, \"website\": null, \"phone_number\": \"Nespecificat\", \"opening_hours\": null}', 0.000000, 0.000000, 1, NULL),
