hor_name\": \"Marina Mihaela\", \"original_language\": \"ro\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocIqy_UFn_Fve58iSDEuZ-VSozh-UXyo_qoU2SUL-1hJeu3D=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"10 months ago\"}, {\"text\": \"I took a last minute vacation. Everything was done quickly, with the utmost kindness and professionalism. My travel agent was Mrs. Carmen Negrea, a super kind lady! Grade 10+++\\nI recommend with love!\", \"time\": 1693551528, \"rating\": 5, \"language\": \"en-US\", \"author_url\": \"https://www.google.com/maps/contrib/100005430129634615162/reviews\", \"translated\": true, \"author_name\": \"Cornelia Dinescu\", \"original_language\": \"ro\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocJj1joAROSsqZGFaF86wBZzUKhtE-ODcpVxF4wgxfqMJpaKAA=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"a year ago\"}], \"weather\": {\"humidity\": 46, \"wind_speed\": 8.23, \"description\": \"clear sky\", \"temperature\": 27.84}, \"website\": \"https://www.plaja.ro/\", \"phone_number\": \"021 320 1025\", \"opening_hours\": [\"Monday: 10:00 AM – 5:00 PM\", \"Tuesday: 10:00 AM – 5:00 PM\", \"Wednesday: 10:00 AM – 5:00 PM\", \"Thursday: 10:00 AM – 5:00 PM\", \"Friday: 10:00 AM – 5:00 PM\", \"Saturday: Closed\", \"Sunday: Closed\"]}', 0.000000, 0.000000, 1, NULL),
