oeme Beach, Eforie Nord, Romania\", \"reviews\": [{\"text\": \"What’s not to like!? Not crowded, no overbearing music just a big beach, plenty of space, good, crashing waves, a gentle sandy incline out but get deep enough to swim pretty quickly, fresh, clean water. Umbrella n chez longes reasonably priced, as was food n beer, loos perfectly serviceable - just great. My family and spent a lovely few days tanning, swimming n just walking along the beach. A perfectly normal, unpretentious crowd. A 20 min, easy (hot) walk from Eforia Norde, recommended rather than drive n figure parking….\", \"time\": 1720517479, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/114451006115550670104/reviews\", \"translated\": false, \"author_name\": \"Douglas Williams\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXMwBn1P209LPyMFuXO0VoswbrZSRSPAcUA2p8YhUjkHI3idEDCbQ=s128-c0x00000000-cc-rp-mo-ba2\", \"relative_time_description\": \"12 months ago\"}, {\"text\": \"Excellent experience! Nice beach. Nice beach bar. Good food. Friendly staff. Recommend!\", \"time\": 1534572044, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/102699361807668000126/reviews\", \"translated\": false, \"author_name\": \"iuli paraschiv\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocJNK9U2JVRGKB7SpCEvikDMYv_aF1iMKhDk9jeNqVzWlMAsXw=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"6 years ago\"}, {\"text\": \"Service: the stuff is welcoming, they offer you all that you need\\nAtmosphere: relaxed, chill\\nConditions: well arranged beach, with nice shezlongs and umbrellas\", \"time\": 1535084316, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/114620205033008249044/reviews\", \"translated\": false, \"author_name\": \"Mircea Serediuc\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjW-4AqCe_ueFamr5Bto75sV1C9U5vmkuOcK4ikNf8iyQL0tN41sAw=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"6 years ago\"}, {\"text\": \"Alright, so the beach had shells scattered around, which made strolling a bit uneven but kinda fun. Service wasn\'t super speedy, but the waiters were nice folks. Best part? It wasn\'t jam-packed, so you could just toss your towel and go enjoy the waves whenever you felt like it.\", \"time\": 1693321438, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/100513471983000922925/reviews\", \"translated\": false, \"author_name\": \"Andrei-Șerban Zanfirescu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjUk9pxSOHmoEusyXdJkGToTKIlPb5ShFsf-ncTQLBsEnUA_TXtrLg=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"Great sea food. The water is clean and have a nice light green color.\", \"time\": 1629805544, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/101574269063969526873/reviews\", \"translated\": false, \"author_name\": \"Alexandru Vîlsan\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjUNl8UCktbxvYL9nAzeobJyZzNDct38b4ri4oNN2Rz-FEhol9Kt=s128-c0x00000000-cc-rp-mo-ba2\", \"relative_time_description\": \"3 years ago\"}], \"weather\": {\"humidity\": 45, \"wind_speed\": 5.27, \"description\": \"clear sky\", \"temperature\": 29.73}, \"website\": null, \"phone_number\": \"0721 350 713\", \"opening_hours\": [\"Monday: 8:00 AM – 12:00 AM\", \"Tuesday: 8:00 AM – 12:00 AM\", \"Wednesday: 8:00 AM – 12:00 AM\", \"Thursday: 8:00 AM – 12:00 AM\", \"Friday: 8:00 AM – 12:00 AM\", \"Saturday: 8:00 AM – 12:00 AM\", \"Sunday: 8:00 AM – 12:00 AM\"]}', 0.000000, 0.000000, 1, NULL),
