ss\": \"Corbu 907085, Romania\", \"reviews\": [{\"text\": \"Not really wild 😹 there was too many people. Guess it’ll be more interesting for people who camp there. Nice restaurant in front. The road to reach there is the worse though\", \"time\": 1725374151, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/115818779976554996450/reviews\", \"translated\": false, \"author_name\": \"Yasmina Aboutaleb\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjUm4CvoMXhy-dn8s4PmAyqd_E3LIf-bPoqGqLrbBhiwKgUiK7hb=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"10 months ago\"}, {\"text\": \"Nice beach to the Vadu beach the road is terrible, if you have a 4x4 car it\'s fine.  The location is superb, the beach is a mixture of sand and shells, and the water is clean but with jellyfish.  campsite for caravans and tents, but you have to take the toilet with you as we didn\'t see any public toilets.  nearby is a chermana where you can eat well and at a reasonable price.  The car permit and the tourist permit are purchased online.  We also had the dog with us, and we also saw a lot of quadrupeds.\", \"time\": 1720551549, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/104512450686134206551/reviews\", \"translated\": false, \"author_name\": \"Paula Costea\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWbBgIJeQHEIjx_A8a9_fKIiJ8y-KJF9CPW_ArkXpBIBA55QBwm=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"12 months ago\"}, {\"text\": \"Very beautiful. Not a lot of people. It\'s like having the entire beach to yourself. Great for camping.\\n\\nThe only problem would be the road to the beach. It\'s very bad, but if you\'re driving slowly, it\'s okay.\", \"time\": 1719405700, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/113587085064053842143/reviews\", \"translated\": false, \"author_name\": \"Teodor Gabriel Nedelea\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocIwDvRgBXrJKbQaDU21OHlUJcizujTPp9g12FGee0XVcEgtOU0Q=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"very nice place, but pretty hard to reach without a car equipped for off road (hard access is what keeps a place nice though)\", \"time\": 1721646704, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/113905509588048331241/reviews\", \"translated\": false, \"author_name\": \"Dan Aparu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocIbajgIospdju2oUb0xigVaJkvy4USZ1Wio_lQ1iun6eD73sQ=s128-c0x00000000-cc-rp-mo-ba2\", \"relative_time_description\": \"11 months ago\"}, {\"text\": \"Quiet place.\", \"time\": 1717250788, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/106191858335550062079/reviews\", \"translated\": false, \"author_name\": \"Tiberiu Ivan (tiberiu_foodie Instagram)\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVV7lBaDW4taGmPmxeXD9HlPhDtlkCUu6L_shvJLrl13M37woT6qA=s128-c0x00000000-cc-rp-mo-ba7\", \"relative_time_description\": \"a year ago\"}], \"weather\": {\"humidity\": 44, \"wind_speed\": 4.26, \"description\": \"clear sky\", \"temperature\": 29.53}, \"website\": null, \"phone_number\": \"Nespecificat\", \"opening_hours\": [\"Monday: Open 24 hours\", \"Tuesday: Open 24 hours\", \"Wednesday: Open 24 hours\", \"Thursday: Open 24 hours\", \"Friday: Open 24 hours\", \"Saturday: Open 24 hours\", \"Sunday: Open 24 hours\"]}', 0.000000, 0.000000, 1, NULL),
