://lh3.googleusercontent.com/a-/ALV-UjWjIYzjLB6CBces5XDip2c1u2jm8g3ylntr20oscqsSoaZ8-rg=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"3 years ago\"}, {\"text\": \"The place is wonderful, very instagramable. Proper distancing to feel safe, not crowded at all. The staff from the beach bar is very nice and the drinks are of good quality. You can rent a pillow for 100 lei / day.\", \"time\": 1595077138, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/114474100450140309703/reviews\", \"translated\": false, \"author_name\": \"Andreea P\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXsDT1Gcgi0pLXaSrNYck-qysbGWL_XhVVP0euC3PSk5XMnKxe8=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"4 years ago\"}, {\"text\": \"Clean, cozy, quite and spacious beach.\\nThe shore has an all-day-round breeze making for a pleasant full beach day.\\n\\nThe beach bar has a generous offering and a scenic seating area. They accept credit cards and online sunbed reservation.\\n\\nThe water\'s not the best with rocky bottom and algee in abundance.\\n\\nThe parking is free, but also improvised and really dusty, with no shade whatsoever. Just find a free spot near the beach road.\", \"time\": 1627730619, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/107065913235568721793/reviews\", \"translated\": false, \"author_name\": \"Horia Niculescu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjX1FUwcETVepJVCUN4mImgk3G3nQbZL6oRey6Z8FD-wdmDJLyf3Ig=s128-c0x00000000-cc-rp-mo-ba6\", \"relative_time_description\": \"3 years ago\"}, {\"text\": \"+ the beach is nice, but that\'s it... There is a combination of sand and pebbles\\n- you can either take sundbeds (30RON one) or some large pillows (60-80RON one)\\n- there are no showers, but I suppose that it is expected somehow, since it\'s a \\\"wild\\\" beach\\n- at Cochilia Bar, the drinks and especially the food is so over priced; for 40 RON (10 💶) you get some chicken (100-150 g) and some salad ... It\'s just a snack, so get some food with you\\n- everything is overpriced, but this is our nice and beautiful country\", \"time\": 1599730402, \"rating\": 3, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/104965457191475812796/reviews\", \"translated\": false, \"author_name\": \"Alexandru Nechifor\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXBOLcZoSHrIwWLDZTtUTQTrxG2xB0EO40BNqikK9pYUI65tNt6=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"4 years ago\"}, {\"text\": \"Beautiful location and really nice people at the bar. A cozy design and just pleasant to be there. Good music too.\\n\\nUnfortunately there is no list of prices for the bean bags, they went up every day we were there and that was frustrating. Not because of the price itself, but because you feel the prices are made up on the spot.\\n\\nA bit overpriced for what you get, but I guess you pay for exclusivity.\\nI\'d give it 3.5 stars if possible.\\n\\nOverall a pleasant experience, we\'ll come back next year.\\n\\np.s. make sure you park your car on the gravel road, further away when it rains. You won\'t be able to get your car out of the mud after 30 mins of rain.\\n\\np.p.s. I had no reception (gps signal) on the right hand side of the beach, as you arrive.\", \"time\": 1626859545, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/101605589832490516546/reviews\", \"translated\": false, \"author_name\": \"Marius R.\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVkDGkfnu_C4Y3B9vgEpXkdGpVbZ_QiqFtvz2k4rR8QvFga7YC_bg=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"3 years ago\"}], \"weather\": {\"humidity\": 46, \"wind_speed\": 4.91, \"description\": \"clear sky\", \"temperature\": 29.49}, \"website\": \"http://www.vongola.ro/\", \"phone_number\": \"0779 969 276\", \"opening_hours\": [\"Monday: 8:00 AM – 9:00 PM\", \"Tuesday: 8:00 AM – 9:00 PM\", \"Wednesday: 8:00 AM – 9:00 PM\", \"Thursday: 8:00 AM – 9:00 PM\", \"Friday: 8:00 AM – 9:00 PM\", \"Saturday: 8:00 AM – 9:00 PM\", \"Sunday: 8:00 AM – 9:00 PM\"]}', 0.000000, 0.000000, 1, NULL),
