laja Tuzla, Romania\", \"reviews\": [{\"text\": \"Lovely place. Quiet and secluded. The cars cannot be parked very close from the beach but the walk from the road to the beach is worthwhile.\", \"time\": 1689773070, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/118146439288700728604/reviews\", \"translated\": false, \"author_name\": \"Georgiana G.\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWOPeAm6J6mhj27RbeHEUncZUls1wKsq-1wAPEfSscNTcXUXeZGeg=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"Really nice beach! Not too crowded, and you have a few bars/restaurants to get something refreshing. Worth to visit!\", \"time\": 1722434157, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/104015353844659954343/reviews\", \"translated\": false, \"author_name\": \"Graham Visser\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWKRMh_BIDs86U2EnnUDMrA9XaG6AJny5B26vmeL86eF9-Z1lwA=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"11 months ago\"}, {\"text\": \"I was there yesterday. The place is beautiful, but that is it. The entrance to the sea is horrible, full of rocks and shells, no sand. Now due to the temperature of water the shore is full of seaweeds which are never cleaned.\\n\\nThe prices are cosmic.\\nUmbrella is 100 lei per person! No, it is not a misstype, it is 100 lei per person.\\nWe were six people, two children included,  and decided just to put a towel, but the staff came and asked us to pay for umbrella, which is illegal, cause the beach is not private, but public.\\n\\nToilet is 5 lei.\\n\\nHalf a litre bottle of plain mineral water is 10 lei.\\n\\nThe way down to the beach is dusty and I can break your legs there on rocks, mind this.\\n\\nThis place is good to visit when the season is finished as a good location for photosets, or just romantic walks, but not as a spot to swim.\\n\\nThe only advantage of this place is a  children\'s playground (free, sponsored by Lidl), where children can stay in shade, draw, play toys and paint the shells and rocks.\\n\\nWill never go there again. Horrible service, huge prices and terrible swimming experience.\", \"time\": 1627889506, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/101418433286680042682/reviews\", \"translated\": false, \"author_name\": \"Даша Жукова\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocJpuJdv_M8YX5Gi_Wje9G7wtq5k_Ko4sWgpQWKt_Zp9C_gxjg=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"3 years ago\"}, {\"text\": \"Very nice quite  virgin beach. We went there just to run away from the noisy people and the garbage from other beaches. We were pretty lucky to find this hidden gem. The seashore is sandy with little pieces of shells, but this joins the charm of the beach. I highly recommend this beach, but with an umbrella and some sheets for the sand because the sunbeds are around 50 lei\\n\\n!!be aware of the snakes in the little forest, we saw one pretty big\", \"time\": 1692089555, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/118203147880537284991/reviews\", \"translated\": false, \"author_name\": \"Stefania\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVdpDMEOctgMNtY-ls2i51Go_jGGUgtmA59IMv74061WB89xSA=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"Pleasant day  in a nice and quiet place 😌. I\'ve been 15 years ago when was just the sand, hope the place will remain 🙏 the same without concrete, asfalt and modern-day stuff. And for those who plan to visit, please keep it 💯 clean and take your garbage with you.\", \"time\": 1690122747, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/118025214201406795107/reviews\", \"translated\": false, \"author_name\": \"Marius Grigoraș\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXDB_jKZXqhbvo47JnG29pPC0WRFFjnvC19Lx29Sc2aBsejl1se=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"a year ago\"}], \"weather\": {\"humidity\": 46, \"wind_speed\": 4.91, \"description\": \"clear sky\", \"temperature\": 29.49}, \"website\": null, \"phone_number\": \"Nespecificat\", \"opening_hours\": null}', 0.000000, 0.000000, 1, NULL),
