address\": \"No Name, Tuzla 907295, Romania\", \"reviews\": [{\"text\": \"Superb!!!\", \"time\": 1692187096, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/113547682517465410054/reviews\", \"translated\": false, \"author_name\": \"Poterasu Lavinia\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjX46oJA5s0L5k4fUyAqpoH3jJLmUyyRH_Ds1cjn5H3ORFa6riMX=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"Amazing people. Beautiful beach.\", \"time\": 1692866143, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/113961635896886914879/reviews\", \"translated\": false, \"author_name\": \"Posa Dorel\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVR2UFGwU191ucNCVlVxZoOw6Sn0fGMXdO92AH-Gu9-qX6C5b2M=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"A place on the Black Sea that makes us keep hoping! Good service, even when it\'s busy, you just need a little patience, being broken by monday anyway and no rush, it\'s supposed to be…\\nThe products are what should be on any domestic beach, chosen and cooked with care and passion.\\nCard payment accepted and functional. The bar, the kitchen without fail.\\nHappy as a clam there, every day!\\n🦪🌶\\n🍲🐟\", \"time\": 1723913246, \"rating\": 5, \"language\": \"en-US\", \"author_url\": \"https://www.google.com/maps/contrib/101578842690376313909/reviews\", \"translated\": true, \"author_name\": \"Cosmin Popa-Drăghia\", \"original_language\": \"ro\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXOdwGUZYEcNmXDupldtWzif_Nn7lqtc7ntfJX2Ao9-WwqkCtWS=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"10 months ago\"}, {\"text\": \"A clean beach, small water at the shore, lifeguards at every step.\\n\\nThe bar is very nicely decorated and the staff is helpful.\\n\\nIt can be paid by card. There is a problem with the GSM signal in the area, it is a bit more difficult to pay, but the employees have the patience to \\\"take your money\\\"😊\", \"time\": 1723829354, \"rating\": 5, \"language\": \"en-US\", \"author_url\": \"https://www.google.com/maps/contrib/109235596093017165788/reviews\", \"translated\": true, \"author_name\": \"Laurentiu Costache\", \"original_language\": \"ro\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocKsOoBDWEyI5LkWry6VMU766jnNOvO2_u5eRMKnxrhsRkDxDA=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"10 months ago\"}, {\"text\": \"I recommend with confidence! Wonderful view, good music, food grade 10 (I recommend the fish that is caught by them), service grade 10 and very kind staff\", \"time\": 1721488521, \"rating\": 5, \"language\": \"en-US\", \"author_url\": \"https://www.google.com/maps/contrib/115857194998789160799/reviews\", \"translated\": true, \"author_name\": \"bej marcell\", \"original_language\": \"ro\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWrZyDKrs2zhmjJ2hTQJKB2J883IL0h_281oP3a5rr90XXrGP8=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"11 months ago\"}], \"weather\": {\"humidity\": 46, \"wind_speed\": 4.91, \"description\": \"clear sky\", \"temperature\": 29.49}, \"website\": \"https://www.yurtaa.ro/\", \"phone_number\": \"0786 970 150\", \"opening_hours\": [\"Monday: 8:00 AM – 11:30 PM\", \"Tuesday: 8:00 AM – 11:30 PM\", \"Wednesday: 8:00 AM – 11:30 PM\", \"Thursday: 8:00 AM – 11:30 PM\", \"Friday: 8:00 AM – 11:30 PM\", \"Saturday: 8:00 AM – 11:30 PM\", \"Sunday: 8:00 AM – 11:30 PM\"]}', 0.000000, 0.000000, 1, NULL),
