ed Road, Gostinu, Romania\", \"reviews\": [{\"text\": \"Nice place to escape from the town.\\n\\nCan be reached by car when it did not rained.\", \"time\": 1609662689, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/104955253092809319384/reviews\", \"translated\": false, \"author_name\": \"Codrut Constantin\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocKtInbkj1Xwyvt3ild7uoGdLe_cs5YrCHRp9V7GfcF3ceO6cg=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"4 years ago\"}, {\"text\": \"Was here on weekdays are so good idea. Pretty quite and i can relaxed.\", \"time\": 1690620414, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/105137783166925199223/reviews\", \"translated\": false, \"author_name\": \"Belz Chan\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXndwSWXJT0tJoc_fHl2gzl_b-gWf8HDiiiZZ2Zt3iQ0Mt1Ln-Y=s128-c0x00000000-cc-rp-mo-ba6\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"ℹ️Ostrovu Lung - Gostinu was declared a Special Avifauna Protection Area for special avifauna protection areas as an integral part of the European ecological network Natura 2000 in Romania  and covers an area of ​​2,489 hectares\\n\\nℹ️The protected area (framed in a continental geographical bioregion) represents a natural area in the Danube meadow (rivers, lakes, sandy beaches, arable lands, pastures, deciduous forests);  which provides food, nesting and living conditions for several species of migratory, transient or sedentary birds (some of which are very rare and protected by law).\\n📌 Amazing area for kayaking, fishing, bird watching or just enjoy Danube shore.\\n\\nℹ️Access to Plaja Gostinu(Gostinu Beach) is very easy from Gostinu village along the Danube shore.\", \"time\": 1592217880, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/116687588887513765409/reviews\", \"translated\": false, \"author_name\": \"Cristi G\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjV5-269wFcYHz_guL3HijEKVhNc6ZGaze__G9-fz8uugHDGRpQgEA=s128-c0x00000000-cc-rp-mo-ba8\", \"relative_time_description\": \"5 years ago\"}, {\"text\": \"Great place ruined by some people. During the weekends expect sleepless nights. Rude, loud, riding dirt bikes all night, the bar next door is playing very loud music until 5am. But during the week it is a dream. Highly recommended but not during the weekend.\", \"time\": 1656155362, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/110706106381299360631/reviews\", \"translated\": false, \"author_name\": \"Catalin Udeanu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocLirzLTJ9h3eWt4IU8KM2SMXgdwgz5r98oBKoMigUbyNz_qoQ=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"3 years ago\"}, {\"text\": \"Really nice place at Donau where you can find interesting black pieces of bitumen. Very fascinating how the relief always changes!\", \"time\": 1649229728, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/107310805845450848067/reviews\", \"translated\": false, \"author_name\": \"Cεzαr Prodan-Hora\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWVGc7v-1CIPenLekbs8a1O8JDEALV7a07agSTbcoTuTxzM53IPQg=s128-c0x00000000-cc-rp-mo-ba6\", \"relative_time_description\": \"3 years ago\"}], \"weather\": {\"humidity\": 38, \"wind_speed\": 5.5, \"description\": \"clear sky\", \"temperature\": 30.52}, \"website\": null, \"phone_number\": \"Nespecificat\", \"opening_hours\": [\"Monday: Open 24 hours\", \"Tuesday: Open 24 hours\", \"Wednesday: Open 24 hours\", \"Thursday: Open 24 hours\", \"Friday: Open 24 hours\", \"Saturday: Open 24 hours\", \"Sunday: Op