\"Olimp Beach, Romania\", \"reviews\": [{\"text\": \"I visited Olymp Beach recently and found it to be decent, although a bit crowded. While there are spots where you can set up your own umbrella, I appreciated the more peaceful atmosphere due to the relatively low music volume. However, I did notice an abandoned car, which was a bit off-putting. It was surprising to find paid toilets in 2023. I would rate my experience four stars for now, with the possibility of revising my review in the future.\", \"time\": 1693133098, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/100513471983000922925/reviews\", \"translated\": false, \"author_name\": \"Andrei-Șerban Zanfirescu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjUk9pxSOHmoEusyXdJkGToTKIlPb5ShFsf-ncTQLBsEnUA_TXtrLg=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"Unfortunatelly 0 :( because noone tells you that the beach has been \\\"redone\\\" and there are rocks in the water, which actually renders the beach unusable :( ... just go to the next one, towards Neptun, which has few rocks and a lot of fine sand !\", \"time\": 1719688889, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/108984204862958849372/reviews\", \"translated\": false, \"author_name\": \"Andrei Cantar\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjX8IXHect2vxlNHsoafPR3hhHHZTCLkQntpaDig0RkQlSScP_EE=s128-c0x00000000-cc-rp-mo-ba2\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"A nice and quiet beach. Probably the best place to relax on the Black Sea. There are not many people present there because the waves are not as big as they are in other locations and that is perfect if you want to feel the breeze and listen to the waves.\", \"time\": 1534439935, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/117558516504970655784/reviews\", \"translated\": false, \"author_name\": \"Mircea Petran\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjU7FRHFg-9aF25aLnuQ7Xycy0NKsK7hteH99m5CF7brA4PHtKc=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"6 years ago\"}, {\"text\": \"Super\", \"time\": 1720522554, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/114605509786927795918/reviews\", \"translated\": false, \"author_name\": \"ANDREI SURUBARIU\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjUQ7i5dVop_RTxrLN17sEq1FciYdnECyJ8oNDGEBxhM8meYCE4=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"12 months ago\"}, {\"text\": \"The biggest beach after Mamaia beach,very clean,the water is clean,without \\\"sea salad\\\" and the prices to have a bench is around 20 RON. But you can stay on the sand with a blanket.\", \"time\": 1535969354, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/108944567607025891066/reviews\", \"translated\": false, \"author_name\": \"Mar Gilbert Andrei\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVY8GD_n438xpgiCRr9ArS38GO088sXRjZdTBIA4D_y0pOWBiE0=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"6 years ago\"}], \"weather\": {\"humidity\": 46, \"wind_speed\": 5.51, \"description\": \"clear sky\", \"temperature\": 29.98}, \"website\": null, \"phone_number\": \"Nespecificat\", \"opening_hours\": null}', 0.000000, 0.000000, 1, NULL),
