ter Beach, Romania\", \"reviews\": [{\"text\": \"Great sand, Waters, waves. The Water has no stones in it with makes it great for swimming. Thends to be somewhat crouded, especially in The afternoon.\", \"time\": 1534401516, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/116565175840251188371/reviews\", \"translated\": false, \"author_name\": \"Mihai Stoica (Von Wolfen)\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVgXPDg0LfmwXquKlKl7II2Ao-AnDiQ55W4wj-kBhX5IWxSRosNUw=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"6 years ago\"}, {\"text\": \"Far too many sunbeds, even in places where there is no access to the sea. The sand is not too great either, and if there is, it is under the sunbeds. I don\'t understand why there is a city tax (5 RON per person per day) when the city or the beach is not being improved. It should be illegal to occupy the beaches only with sunbeds\", \"time\": 1662443528, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/113413417839744256423/reviews\", \"translated\": false, \"author_name\": \"Muttley Silviu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVKBSSSQtLuOEDllji7ck8aJT7B4hGHLNvRRT4Um41HJWVJZqg=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"2 years ago\"}, {\"text\": \"Great sand, plenty of sunbeds, but lacks done music. It\'s usually crowded. Sunbeds cost about 5.50€ each. There\'s also a beach bar there\", \"time\": 1500054057, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/117168078007032901822/reviews\", \"translated\": false, \"author_name\": \"Alex Iacob\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVHTCHmFa8OSxxvRGhp8I07vaI2S6jwcjyMTZCyr9l8EleQYMjlrQ=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"7 years ago\"}, {\"text\": \"No one clean it but it so nice\", \"time\": 1568318017, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/104208290018678727896/reviews\", \"translated\": false, \"author_name\": \"Coralia EL-Hallak\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjURX3L7v92UUwHR67UJqpQy2ITH1qbZfplPBQkryhlPDRZMTLo=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"5 years ago\"}, {\"text\": \"Nice but is\'int a sand beach. Its shell beach.\", \"time\": 1727185591, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/105337088094814506267/reviews\", \"translated\": false, \"author_name\": \"Paweł Kandulski\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWIyWzygH1JkVVRu8SEyIGJyj7VjzaoLGsDbDiADoCnd_Zk_54p=s128-c0x00000000-cc-rp-mo-ba6\", \"relative_time_description\": \"9 months ago\"}], \"weather\": {\"humidity\": 48, \"wind_speed\": 5.43, \"description\": \"clear sky\", \"temperature\": 29.96}, \"website\": null, \"phone_number\": \"Nespecificat\", \"opening_hours\": null}', 0.000000, 0.000000, 1, NULL),
