vsNQse1tRlvF_Bu8XSettXeTmL1IirKAoegkzMsrdux0PBoNqVZGFFdB95SDAuKwPdB_xjw97fgW6J80fyglzkEd5RqmgAfPexqizNCdbigmCdihqiAsAv3r-1bCgbKqKJIV7710x6D3n6U-g_5p0x-R5yam3gMFxFkotV31b-vxJEhcgpBKC8EFFW4WkuZHtu8QVruaPi57T0bxC9nWZnE217sqyp2_Qn8-jA3IWi-nndh9mCamIVNGDAdnRFMlzTh2brFnpRKyoqva0CFPnnlVr2tB_698YFRv-DF8-T3slGK-Mv061cshfbXB2fKArnJ2sZQ-mjFTrJrVhzI4fTaeJbi1NIm8aB91N8PBQbLcvxcUO4duHNhscHaXeCLe-_LMPChASnTRntEKI443Odbhsh1s0CkIChhWOA23YFZt_kebWBZWm99b3YKZ1yLjdgER1wzYvZ_ud_b1f2w2rU2SqDn5JQLUHST-oCi0xBjWOsbC1XDpxkEWfKfqms&key=AIzaSyAFx94qZOmhNHRgEm17hh9C83bP_xXEwFI\", \"https://maps.googleapis.com/maps/api/place/photo?maxwidth=600&photoreference=ATKogpdlc0TVK2ldgc9yuoN6GFmrUF1d5fJRbB5m5YwWkpsGlxIh3O2P4hukxHp-ro9DhhBcErWrC2tlS4_8PrBdEvBabKaTALccZk0j6JyWCSoY7a7APH_Ym1WadI0NnAm5pBOIZrY61o6StpX4x__LQi3YrMlY2MPPH6uU76h03qO592P0wuEYPxNI20As8R0jUeGMS6ugqcOKRyiRwtNeuQhEtPagLfSWdrlejft6HlViAeu9CymQ4XMD37KMKLBIoSkWDCLxBkRBpW7b18SaqUCgRL1lGzmGbXK_HluJ5fME-Wq-kmkBMfo7gQKCBBN69v-PYWlJUGA&key=AIzaSyAFx94qZOmhNHRgEm17hh9C83bP_xXEwFI\"], \"rating\": 3, \"address\": \"Alaçatı, 18001 Sokak No:6/1, 35930 Çeşme/İzmir, Türkiye\", \"reviews\": [{\"text\": \"I spent the day here today, as a solo American tourist. The place is nice, plenty of seating and made reservation through my hotel. It is pricy, but I expected it. Not many English speakers but I made due with my bare Turkish. I would return actually, despite slow service, the atmosphere is very good and had a DJ.\", \"time\": 1726066359, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/104109371838499163085/reviews\", \"translated\": false, \"author_name\": \"Kayla Kelly\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocKR8B259Qf9WoD7wDfg0-r0D9hd8ejF8HD3qFLiq1f0GVmmyA=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"9 months ago\"}, {\"text\": \"I don’t usually review, but this place feels like a scam. They will try to extract money from every points; from the valet and entry fee of 1,000 each. The place is still in construction, out of everything. I’ve been to many high quality beach club but this one is not one of them. Everything looks cheap and tacky, from the beach towels to sun-beds. Expected to pay £18 cocktail. Scam! run away!\", \"time\": 1748503971, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/108296453609719103109/reviews\", \"translated\": false, \"author_name\": \"Mooka Srisurayotin\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWXtxG0tZJYvwmzgmDMkUsMMF-srYivYOVuq4t5xK8KnakpqAN5=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"a month ago\"}, {\"text\": \"Is zero stars was an option I’d select that! Entrance fee on top of minimum spend is a joke. Sun bed mattresses look like that at a homeless shelter. Sponsorship on towels reinforces how cheap the place is. No music throughout beach club. Pretentious crowd. All round sloppy, unpolished, unmaintained and unfinished.\", \"time\": 1724410731, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/107059981990933213891/reviews\", \"translated\": false, \"author_name\": \"Andrew Mead\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocL-V-dPhvSGdtf30qLyXIjNVrgOONytaFTp1Gqb6dddvrifig=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"10 months ago\"}, {\"text\": \"The beach is very clean, the vibes are very nice, one of the best beaches in alacati, but the service is very ill. Most of the staff are not friendly. They do not care about customer satisfaction whatsoever\", \"time\": 1749993501, \"rating\": 3, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/111816689595600455310/reviews\", \"translated\": false, \"author_name\": \"Reema kh\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocIpsQHDGIZl6SfsG_U7vH_57fQnsRW91Bp4Bhab8yGApAdAcw=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"2 weeks ago\"}, {\"text\": \"I had a very disappointing experience at this beach. Instead of the pepperoni pizza I ordered, I received a very low-quality pizza with sucuk that didn’t meet my expectations at all. The price was also ridiculously high; 850 lira for such a low-quality pizza is simply unacceptable. Moreover, the beach was extremely windy, making it nearly impossible to enjoy the water. I definitely do not recommend this place.\", \"time\": 1725282190, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/102945311196207388663/reviews\", \"translated\": false, \"author_name\": \"Romina ghaderi vaghari\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVdaNnFbgbqRf-ejFlvGBgsTpO68aylSUNTZzck5WEcQPtxghoF=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"10 months ago\"}], \"weather\": {\"humidity\": 41, \"wind_speed\": 6.02, \"description\": \"clear sky\", \"temperature\": 27.97}, \"website\": \"https://kalibeach.com/\", \"phone_number\": \"0533 053 98 44\", \"opening_hours\": [\"Monday: 10:00 AM – 10:00 PM\", \"Tuesday: 10:00 AM – 10:00 PM\", \"Wednesday: 10:00 AM – 10:00 PM\", \"Thursday: 10:00 AM – 10:00 PM\", \"Friday: 10:00 AM – 10:00 PM\", \"Saturday: 10:00 AM – 10:00 PM\", \"Sunday: 10:00 AM – 10:00 PM\"]}', 0.000000, 0.000000, 1, NULL);
