a Beach, Saturn, Romania\", \"reviews\": [{\"text\": \"entertaining music, a bit too loud, lots of plants ;) - next to the water park if you do come here with kods\", \"time\": 1629021987, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/114423305189699049438/reviews\", \"translated\": false, \"author_name\": \"andreea ovessea\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocLIcByiqOQWofxt9LiFMTx-zDo1MhuBDItEmlFgYWmiK0JBEA=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"3 years ago\"}, {\"text\": \"You need to know what to expect:\\nGood sand\\nNot very crowded\\nPaid parking\\nAverage fares\\nGood music\\nPaid shower&toilet\\nLong walks in the beach\\nYou can almost see the dawn\", \"time\": 1628344527, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/114377077427412936488/reviews\", \"translated\": false, \"author_name\": \"Dorina Abrudan\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVwxUxqKzOJvOdujK_waJUtnUdhjnesKQZbeBt2Vqrn7gfSdhc=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"3 years ago\"}, {\"text\": \"Rough and overcrowded sunbeds, low quality umbrellas and high fares.\", \"time\": 1597226273, \"rating\": 2, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/104733327545854285116/reviews\", \"translated\": false, \"author_name\": \"Constantin Lecea\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocIMyb-TKj3JQJdVK1HCa3FcA_pDA3LMIbK6BgP_gO3ArMFImQ=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"4 years ago\"}, {\"text\": \"Beautiful big wide beach. Only a small portion of shells separate you from the sea which has a comfy sandy bottom. The water here is also quite low for meters and meters so very safe.\", \"time\": 1536181833, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/103775544319038120503/reviews\", \"translated\": false, \"author_name\": \"Andra\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWUou7i_Oufuw__RlNOeOWp8Ge6wsXsoH8ef8yCdiy47zmYhU_o2Q=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"6 years ago\"}, {\"text\": \"Excelent beach . Spend every vacation here last summer .\", \"time\": 1664888633, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/110647693854818368493/reviews\", \"translated\": false, \"author_name\": \"Julian P\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWKlqELIrWB-XUjYx9s8OQghKoyKrKImKOUurdpGi28hunI7_ZRSQ=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"2 years ago\"}], \"weather\": {\"humidity\": 49, \"wind_speed\": 5.36, \"description\": \"clear sky\", \"temperature\": 30.13}, \"website\": null, \"phone_number\": \"Nespecificat\", \"opening_hours\": null}', 0.000000, 0.000000, 1, NULL),
