ddress\": \"Aleea Lamia nr.6, Mamaia, Romania\", \"reviews\": [{\"text\": \"Very nice place, unfortunately not educated customer allowed on the beach.\", \"time\": 1750101927, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/108415044593288750109/reviews\", \"translated\": false, \"author_name\": \"Iulia Stempurszki\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocKDGzivLY5__VPEXsDBf_2I7kyCNIk2N8fCM_iTJtjhvX37ag=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"2 weeks ago\"}, {\"text\": \"Great vibe!\\nWith the bar, the beach, kite spot, friendly people, volleyball courts, perfect music it’s a place for relaxation and enjoyment of simple things in life.\", \"time\": 1691314966, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/117776430159396742807/reviews\", \"translated\": false, \"author_name\": \"Tudor Toma\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocIeajKtiOmjRh7dk2kFcJhNeuX65fXWgqBp-j5bS05wbdm4PA=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"Wasn\'t sure about the big beach pillows/cushions but supper comfy. Friendly staff, they where busy but attentive. Very reasonable pricing. It is unfortunate that thier app doesnt work for ordering drinks but maybe next time.\", \"time\": 1659783302, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/109578004369158757280/reviews\", \"translated\": false, \"author_name\": \"David Crews\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjW5JnhCk8HZWhGH_zc9WFzbQ3VPPUWJnWcXP8pJihrf82PF4EwOdQ=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"2 years ago\"}, {\"text\": \"Nice place for spend your time at the beach, friendly stuff the price for pillow per person is 30ron and all the drinks price are quite ok!!\\nWhat i love on this beach is you can\'t hear the music and you can read a book quietly!\", \"time\": 1655810633, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/101532430915645095843/reviews\", \"translated\": false, \"author_name\": \"Cozma Stefan\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWYQ11l6wO9qQMZV2OTfEXPa3G09SpAKOdY6lkzjN2CmlM-FzU=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"3 years ago\"}, {\"text\": \"I do like this spot, but I am bothered by the inconsistency. I am a big PassionFruit Martini (2nd drink in the cocktail Menu) drinker and I was so looking fw to getting one once again. Unfortunately the experience has been different this time, different presentation and quantity (take a look at the attached pictures). I just want to come back and know what to expect.\\n\\nFirst picture is this time, the second one is the previous cocktail look.\", \"time\": 1692549074, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/103338712295801769122/reviews\", \"translated\": false, \"author_name\": \"Bogdan Bogzeanu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXk0fw9bQ-fl2Q7B95jAyNRNKNnUNqtv4CMgBlh3BaUGtCM4YI=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"a year ago\"}], \"weather\": {\"humidity\": 42, \"wind_speed\": 4.63, \"description\": \"clear sky\", \"temperature\": 29.62}, \"website\": \"https://www.facebook.com/plajah2o\", \"phone_number\": \"Nespecificat\", \"opening_hours\": [\"Monday: 9:00 AM – 9:00 PM\", \"Tuesday: 9:00 AM – 9:00 PM\", \"Wednesday: 9:00 AM – 9:00 PM\", \"Thursday: 9:00 AM – 9:00 PM\", \"Friday: 9:00 AM – 5:00 AM\", \"Saturday: 9:00 AM – 5:00 AM\", \"Sunday: 9:00 AM – 2:00 AM\"]}', 0.000000, 0.000000, 1, NULL),
