n Beach, Romania\", \"reviews\": [{\"text\": \"Too expensive for what services they offer but is still a nice place to enjoy the sand, sun and beach!\", \"time\": 1657741436, \"rating\": 3, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/116899789249581060831/reviews\", \"translated\": false, \"author_name\": \"Radu Mocanu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWwR1dZ-Fd926xb3oRJ2KL3dGu0Y2Le0X2BEZylZS4LKYX51DZd=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"2 years ago\"}, {\"text\": \"Great views nice warm sea\", \"time\": 1751295751, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/111097941320974064381/reviews\", \"translated\": false, \"author_name\": \"Roger Langhor\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXIyNzsUqU3ZisQxM1Rk5RKMqmXqm6k1Tr4WA7zNXwxPmh5IBFk=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"in the last week\"}, {\"text\": \"The beach service is terrible. The price for the sunbeds are expensive considering the place is mostly \\\"dead\\\" and after you pay for them they come and tell you that only one person can sit on the sunbeds at a time and that you either sit in rotation or buy more. You can\'t sit more than one because they \\\"break\\\". I\'ve been with my family there and don\'t find it convenient to buy 2 extra sunbeds (40ron each) for the kids to sit because they say that those break. In Eforie Nord the prices are cheaper and you can sit as many as you like, no one will tell you otherwise.\", \"time\": 1720430360, \"rating\": 2, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/109002254434838266294/reviews\", \"translated\": false, \"author_name\": \"Magic Gamer\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWCePANyRS4I7xt17Q0Pc6doGVjQes9iFtttyhSRYyrz2kVDIEW=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"12 months ago\"}, {\"text\": \"Very clean,relaxing and friendly staff on the beach. You need to get there early to catch a sun lounger as they are going really quick.\", \"time\": 1628818855, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/114765915963878790714/reviews\", \"translated\": false, \"author_name\": \"Sergiu Oproescu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocL_O5e-fJ7YodtHbvafbGY6rbBL-KoLv3DjElzhtLq4nUHlQw=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"3 years ago\"}, {\"text\": \"Nice place specially for families with kids. Maybe additional cleaning is needed.\", \"time\": 1593548011, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/116750972284984931135/reviews\", \"translated\": false, \"author_name\": \"Adrian Piperea\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjV9k6ejP7o0WVQzXW658Gn7HgYW4hnS7ir4Gu5kgD2rkcHQCS-l-g=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"5 years ago\"}], \"weather\": {\"humidity\": 49, \"wind_speed\": 5.36, \"description\": \"clear sky\", \"temperature\": 30.13}, \"website\": null, \"phone_number\": \"Nespecificat\", \"opening_hours\": null}', 0.000000, 0.000000, 1, NULL),
