Pc6doGVjQes9iFtttyhSRYyrz2kVDIEW=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"12 months ago\"}, {\"text\": \"Very clean,relaxing and friendly staff on the beach. You need to get there early to catch a sun lounger as they are going really quick.\", \"time\": 1628818855, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/114765915963878790714/reviews\", \"translated\": false, \"author_name\": \"Sergiu Oproescu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocL_O5e-fJ7YodtHbvafbGY6rbBL-KoLv3DjElzhtLq4nUHlQw=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"3 years ago\"}, {\"text\": \"Nice place specially for families with kids. Maybe additional cleaning is needed.\", \"time\": 1593548011, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/116750972284984931135/reviews\", \"translated\": false, \"author_name\": \"Adrian Piperea\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjV9k6ejP7o0WVQzXW658Gn7HgYW4hnS7ir4Gu5kgD2rkcHQCS-l-g=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"5 years ago\"}], \"weather\": {\"humidity\": 49, \"wind_speed\": 5.36, \"description\": \"clear sky\", \"temperature\": 30.13}, \"website\": null, \"phone_number\": \"Nespecificat\", \"opening_hours\": null}', 0.000000, 0.000000, 1, NULL),
