"Plaja 2 Mai, 2 Mai, Romania\", \"reviews\": [{\"text\": \"Quiet and clean, great for a no fuss holiday. The water was clean, warm and the shore was not steep, the kids had a great time and I recommend acvamarin for lunch.\", \"time\": 1724155326, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/111197521896467438029/reviews\", \"translated\": false, \"author_name\": \"Sabina Am\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjUcXsDNU7R1rwyzjfRPNLcKQ8OyvMrynRaWLnN8s7p-gdCs5WE=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"10 months ago\"}, {\"text\": \"A nice and quiet beach,great for families. A beach bed is 30 RON. The water is shallow and the sand is fine.\", \"time\": 1723018818, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/106047518005326695133/reviews\", \"translated\": false, \"author_name\": \"Silviu Muntean\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVVWHaPG3MHaNib_1h_hSVwgOAMHmqK_zOSbcLrkBLxzq8Z0BDC=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"11 months ago\"}, {\"text\": \"Good place to spend a part of your summer. It\'s a family place , with camping facilities. There are eating options, although not many. You can shop for groceries in Mangalia or jn the local town, and cook there. The water is not that shallow at the shore, as in other beaches.\", \"time\": 1626410594, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/109632227599427517099/reviews\", \"translated\": false, \"author_name\": \"Irina Moinescu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVLKQLTZvG5_eV5yLUko53YXdQvvRcyyKq7k14Y7CLxioto70-QlA=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"3 years ago\"}, {\"text\": \"Quiet beach in the fall! Great for kids as water is low and warmer in the little man created golf.\", \"time\": 1729166789, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/116611523160975461297/reviews\", \"translated\": false, \"author_name\": \"Liana M.\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocJ7GEa7AyQAaXDCf35653CvmkEBA0mV5s_NNmEMKhGDqu5Aog=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"8 months ago\"}, {\"text\": \"A nice beach for spending holiday with family. Sand is fine, water is not so deep but if you catch a windy day can be a small adventure in some places more exposed to waves. There is a mini golf, sunbeds areas, sheets areas, a nudist beach, restaurants and bars more or less close to the see. The prices are acceptable and is very close to Vama Veche.\", \"time\": 1657945333, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/107206257986748393208/reviews\", \"translated\": false, \"author_name\": \"Burghelea Oana\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocL4iEHrZZk9WRPvqWzzavVIzuutLU-wp9N5AIlxLEK8WuTrudQ=s128-c0x00000000-cc-rp-mo-ba6\", \"relative_time_description\": \"2 years ago\"}], \"weather\": {\"humidity\": 46, \"wind_speed\": 5.23, \"description\": \"clear sky\", \"temperature\": 28.96}, \"website\": null, \"phone_number\": \"Nespecificat\", \"opening_hours\": null}', 0.000000, 0.000000, 1, NULL),
