\": \"YUVA Beach Bar, Strada Falezei 7, Vama Veche 907163, Romania\", \"reviews\": [{\"text\": \"Yuva Bar in Vama Veche has been a favorite of mine for years, even before they relocated. The food consistently impresses with its quality and flavor, making every visit a culinary treat. The pool and sunbed area are always spotless, offering a relaxing daytime retreat. The staff goes above and beyond, bringing warmth and attentiveness to the experience. When night falls, Yuva transforms into a party hotspot, with wild and unforgettable vibes. It’s the perfect blend of relaxation and excitement. Kudos to the team for maintaining such high standards—keep up the great work!\", \"time\": 1724417133, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/111784807611482466361/reviews\", \"translated\": false, \"author_name\": \"Alina G\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVpNKWhQzWP0QkbCe4zy_3TNnDeLFY1oYwumqC73bXFinj1MM4J=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"10 months ago\"}, {\"text\": \"You\'re by the Black Sea shore? Either you\'re in Romania or Bulgaria don\'t miss out this place! Everything is cool, crowd, atmosphere,view, music... Bartenders are creative and friendly, you won\'t want to leave the bar. From dusk till down unforgettable experience!\", \"time\": 1470735084, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/109867330979366724330/reviews\", \"translated\": false, \"author_name\": \"Florian Micu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocIs1c3vyV0DOXDXzsZ6MTySS8rb0JSw_JzgRjlyDxzTdydZHw=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"8 years ago\"}, {\"text\": \"The only place in Vama Veche worth going to. Probably top 2 clubs at the seaside in Romania.\\n\\nThe atmosphere at night is great.\\n\\nDuring the day the vibe is chilled.\\n\\nDecor is high spec.\\n\\nThe food is excellent. Tuna steak and pork escalope is Yum! 😋\\n\\nThey have amazing coffee too. With oat milk for those that don\'t like or can\'t have dairy. Yay! 😁\", \"time\": 1689629030, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/108620066533129662350/reviews\", \"translated\": false, \"author_name\": \"C\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocJ7_T6PEUAaoQ3nEat9Qp-zTCdQzpwtGVXLGGoiekwNvMEsgUk=s128-c0x00000000-cc-rp-mo-ba5\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"Every time I visit Vama Veche i get a cocktail at Yuva. I really like how they are mixing the drinks, how they use their creativity and how they always surprise me. The price of an cocktail is around 25-30 lei (5-6 €). The location is also amazing and I very much like the attitude of the personnel. On Saturday night they had life music.\", \"time\": 1558905914, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/106116374867738635212/reviews\", \"translated\": false, \"author_name\": \"Ioana Bratinka\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVeujVyK9FUrG2IyHM6zQi-aWIcT5JXw48L8yZrMKth_tPct_2S=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"6 years ago\"}, {\"text\": \"Delicious food! 😋 Beautiful views! 🌊☀️ Slow and a bit unwelcoming service 😬, but I\'d go back. 😊\", \"time\": 1496854114, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/105402866553219256945/reviews\", \"translated\": false, \"author_name\": \"CrisAlex MAC\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjVc_bISN8ypgoHTBU1Q9fITvjmzwa6Ileh6B77jI6hfiUeJzKYX=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"8 years ago\"}], \"weather\": {\"humidity\": 47, \"wind_speed\": 5.15, \"description\": \"clear sky\", \"temperature\": 28.91}, \"website\": \"http://www.yuva.ro/\", \"phone_number\": \"0723 205 959\", \"opening_hours\": [\"Monday: Open 24 hours\", \"Tuesday: Open 24 hours\", \"Wednesday: Open 24 hours\", \"Thursday: Open 24 hours\", \"Friday: Open 24 hours\", \"Saturday: Open 24 hours\", \"Sunday: Open 24 hours\"]}', 0.000000, 0.000000, 1, NULL),
