2, \"address\": \"Strada Promenada, Mamaia-Sat 905700, Romania\", \"reviews\": [{\"text\": \"The food itself was very good, and the sea view definitely helped ease the frustration, but the service needs improvement on the beach area only — especially in terms of coordination and attentiveness.\\nAtmosphere is amazing!\\nI will still come back as is one of my favourite place to relax while we are in the area.\\nThank you, Azimuth!\", \"time\": 1750515881, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/102838206174214967128/reviews\", \"translated\": false, \"author_name\": \"Andreea Prajescu\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWbgzu4eucA2zlxpClO0vmSaWddcJ2465Or7npX4g90g9PuzVQm=s128-c0x00000000-cc-rp-mo-ba4\", \"relative_time_description\": \"a week ago\"}, {\"text\": \"From the moment we arrived, this seaside gem swept us off our feet. Nestled right on the water’s edge, the view alone is worth the visit — golden sunlight dancing on the waves, sailboats drifting by, and the peaceful sound of the ocean setting the perfect mood. The food was outstanding and fresh.\", \"time\": 1751054587, \"rating\": 5, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/103757326266647746900/reviews\", \"translated\": false, \"author_name\": \"Alexandru Toma\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a/ACg8ocKufi6FgvWtsOp0T-6ObTCNPYQ5QfZYBJKryxCOh6THns82MA=s128-c0x00000000-cc-rp-mo\", \"relative_time_description\": \"a week ago\"}, {\"text\": \"4 different days family review (English speaking): we have experienced 5 star service and -2 star service on our stays at Azimuth. Everything from 25 questions about what we want from waiters (great attention) in a day, to not being asked or served once in a day. We have experienced being placed and thrown away from our bed due to internal mistakes (was reimbursed) to getting the perfect spot. We have experienced music being blasted the whole day at 110db and ruining our ears, to a fantastic atmosphere and nice lounge, beach music the whole day.\\n\\nFeedback:\\nEnglish speakers need English waiters, we got misunderstood on several orders and when it’s brought it’s to late, we paid a 65lei tip when we said 35lei, we ended in numerous confusions because English was so poor that it was hopeless at times.\\n\\nMusic need to be turned down (on family side), I understand party factor on the 18+ side, but on family side we saw and include our self 7-8 groups move around trying to find the “low sound spot” due to ear wrecking blasting from speakers.\\n\\nPrices are steep but worth it for the exclusivity and not as crowded as other beach venues.\\n\\nThey have a fantastic manager that saved this review from a 1-star to a 3-star. I do t remember her name, but you know who you are.\\n\\nThe waiters should get some customer service training, as I experienced my self a lot of them just watching the ground, their phone or just chatting with each other 95% of the time, while there was multiple guests/sun beds wanting to order. We mostly ended up going to the bar our self.\\nThis was also seen 10-15 other beds experiencing and frustration arose.\", \"time\": 1720871013, \"rating\": 3, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/102108884893013862621/reviews\", \"translated\": false, \"author_name\": \"Marius Jansen\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjXO5MMlVp1JrPBPKSESYxTyBIJyMmOz3sV9jky5ZlRt4_vMJGWIMA=s128-c0x00000000-cc-rp-mo-ba3\", \"relative_time_description\": \"11 months ago\"}, {\"text\": \"Extraordinary beautiful location and beach set up. Sun beds 100 lei Monday to Thursday and 150 lei Friday to Sunday.\\nThe restaurant and it’s service would be perfect if the waiters would also offer you a smile.\\nMissing is completely a kids friendly menu. On the question if they would also serve something like plain rice, some potatoes or a plain chicken steak for our daughter, the waiter just said no. So you know in case you plan to have your meal there, it’s not kids friendly.\\nOn the beach they serve pizza though, which thankfully also kids enjoy.\\nAlthough at the beach the waiters have the same attitude, if you do not insist on them with the orders they forget and you end up starving.\\nToo bad as the location itself is really beautiful and  you could feel like you are on some exquisite island. But unfortunately the rest is bittersweet.\", \"time\": 1690371105, \"rating\": 4, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/114034384314045008795/reviews\", \"translated\": false, \"author_name\": \"Lua Sav\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjV4IRicS9ai6_IxGKxdGfh7HPhNlttW8hVHhOkDMx55ky0RbsRr=s128-c0x00000000-cc-rp-mo-ba6\", \"relative_time_description\": \"a year ago\"}, {\"text\": \"Horrible bartenders, they tried to fool me the rd time. If you want to know exactly who, it was on the june 27. It was not that crowded and they were passing us one to another trying to put items on the bill more than once. Be careful. Very disappointed\", \"time\": 1751103118, \"rating\": 1, \"language\": \"en\", \"author_url\": \"https://www.google.com/maps/contrib/104803734530067154073/reviews\", \"translated\": false, \"author_name\": \"Cristina Milotin\", \"original_language\": \"en\", \"profile_photo_url\": \"https://lh3.googleusercontent.com/a-/ALV-UjWmjSa8pvhxuP4F-uFy9lU3vVMvuk_e-YLemgOMgVZ1B2JDEjNY=s128-c0x00000000-cc-rp-mo-ba2\", \"relative_time_description\": \"in the last week\"}], \"weather\": {\"humidity\": 42, \"wind_speed\": 4.63, \"description\": \"clear sky\", \"temperature\": 29.63}, \"website\": \"http://azimuthbeach.ro/\", \"phone_number\": \"0790 110 099\", \"opening_hours\": [\"Monday: 8:00 AM – 12:00 AM\", \"Tuesday: 8:00 AM – 12:00 AM\", \"Wednesday: 8:00 AM – 12:00 AM\", \"Thursday: 8:00 AM – 12:00 AM\", \"Friday: 8:00 AM – 3:00 AM\", \"Saturday: 8:00 AM – 3:00 AM\", \"Sunday: 8:00 AM – 12:00 AM\"]}', 44.294207, 28.542035, 1, 'Strada Promenada');
